import React,{Component} from "react";

class Classcom extends Component{
   constructor(){
      super();
      this.state={
         name:'suresh',
         count:0
      }
   }
  
   render(){
      return(
         <>
         <h1>{this.state.name}</h1>
         </>
      )
   }
}
export default Classcom;
